  \"The potential for contaminant exposure to bald eagles (Haliaeetus leucocephalus)
  of the James River, Virginia: Prey contaminant studies\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:24.500861\",\n\t\"name\": \"the-potential-for-contaminant-exposure-to-bald-eagles-haliaeetus-leucocephalus-of-the-jame\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The James River, Virginia has one of the
  largest concentrations of bald eagles (Haliaeetus leucocephalus) on the east coast
  of the United States. Fish constitute up to 90% of the diet of eagles in this area.
  A contaminant study of James River fish was conducted to determine the potential
  risk to bald eagles from the consumption of contaminated prey. Several chemical
  compounds were detected at elevated levels in fish from the James River. Dichlorodiphenyldichloroethylene
  (DDE), cis-nonchlor, trans-nonchlor, polychlorinated biphenyls (PCB), arsenic, cadmium,
  copper, and lead concentrations were all above the National Contaminant Biomonitoring
  Program 85th percentile concentrations in fish. These environmental contaminants
  may be bioaccumulating or in some cases biomagnifying in the food chain. If these
  processes are occurring there is a potential risk to the James River bald eagle
  population. Polycyclic aromatic hydrocarbons (PAH) levels were at detection limits
  and, therefore, at such low levels that they do not pose a concern.\",\n\t\"license_title\":
